import logo from './logo.svg';
import './App.css';
import Nav from './components/Nav';

function App() {
  const tabs = [
  {
    id:1,
    name: "Home"
  },
  {
    id:2,
    name: "About"
  },
  {
    id:3,
    name: "Logout"
  },
  ]
  return (
    <div className="App">
      <link href='https://fonts.googleapis.com/css?family=Nunito' rel='stylesheet'></link>
      <Nav tabs={tabs}/>
    </div>
  );
}

export default App;
